var vacinas = [
  {
    nomeVacina: 'janssen',
    numDosesNecessarias: 1,
    diasEntreDoses: 0,
  },
  {
    nomeVacina: 'pfiiizerrr',
    numDosesNecessarias: 2,
    diasEntreDoses: 90,
  },
];

function isAdmin({ token }) {
  return token === 1; //TO-DO botar uma logica nisso
}

function getVaccineList({ token }) {
  return vacinas;
}

